import { Form, InputGroup, Col, Button } from 'react-bootstrap'

const CustomFields = props => {
    return (

        <Form.Row style={{ padding: '1% 2%' }}>
            <Form.Group as={Col} lg={5} md={5} sm={12} xs={12}>
                <Form.Label style={styles.label}>Field Name</Form.Label>
                <Form.Control as="select" value={props.name}>
                    <option>Aaaa</option>
                    <option>Bbb</option>
                    <option>Ccc</option>
                </Form.Control>
            </Form.Group>
            <Form.Group as={Col} lg={7} md={7} sm={12} xs={12}>
                <Form.Label style={styles.label}>Field Value </Form.Label>
                <InputGroup>
                    <Form.Control
                        type="text"
                        placeholder="Enter Value"
                        name="sku"
                        value={props.value}
                    />
                </InputGroup>
            </Form.Group>
            <Button variant="outline-primary" size="sm" block style={{ width: '100px' }} onClick={props.delete}> delete</Button>
        </Form.Row>
    )
}

const styles = {
    card_header: {
        alignItems: 'center',
        // color: '#6A7074',
        fontSize: '15px',
        background: 'lightgray'
    },
    label: {
        fontSize: '13px',
    }
}
export default CustomFields;
